import React from 'react'
import styled from 'styled-components'

export default function GistBody({createdDate , updatedDate}) {
  return (
   <>
   <Wrapper>
    <TextWrapper>
        Created at: 12/02/2023{createdDate}
    </TextWrapper>
    <TextWrapper style={{marginLeft: 10}}>
        Last Updated: 12/02/2023{updatedDate}
    </TextWrapper>
   </Wrapper>
   </>
  )
}
const Wrapper = styled.div`
   display: flex;
   justify-content: flex-start;
    flex-wrap: wrap;
    align-items: center;
`
const TextWrapper = styled.text`
    font-size: 12px;
    font-weight: 500;
    color: #656565;
`
